import sys
import heapq

def solve():
    N, M, s, t, f = map(int, input().split())
    adj = [[] for _ in range(N)]
    for _ in range(M):
        u, v, a, b, d = map(int, input().split())
        if u == v:
            print("Impossible")
            return
        adj[u].append((v, a, b, d))
    cost = [[float('inf')] * (f + 1) for _ in range(N)]
    cost[s][0] = 0
    pq = [(0, s, 0)]
    while pq:
        c, u, rem = heapq.heappop(pq)
        if c > cost[u][rem]:
            continue
        for v, a, b, d in adj[u]:
            if rem + d <= f:
                new_cost = cost[u][rem] + a * d + b * (rem + d - d)
            else:
                new_cost = cost[u][rem] + a * (f - rem) + b * (f - rem)
            if new_cost < cost[v][rem + d]:
                cost[v][rem + d] = new_cost
                heapq.heappush(pq, (new_cost, v, rem + d))
    if cost[t][f] == float('inf'):
        print("Impossible")
    else:
        print(cost[t][f])

if __name__ == "__main__":
    solve()
